  `descr` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '描述',
  `tentant_id` bigint(20) DEFAULT NULL COMMENT '租户id',
  `c_id` bigint(20) DEFAULT NULL,
  `c_time` datetime DEFAULT NULL,
